import React, { Component } from 'react';


const Weather = props =>(

<div>
<p>city:{props.json1.city.name}</p>
<p>Date:{props.date}</p>
<p>Time:{props.city}</p>
<p>temp:{props.temp}</p>


</div>

)

export default Weather;
